import React from 'react';
import Layout from '../Templates/Layout';

import Button from 'react-bootstrap/Button'

const HomePage = () => {
  return (
    <Layout>
      <div className="container-fluid text-center vert-center-md">
        <h1 className="display-4">PeerPrep</h1>
        <h3 className="pt-3">Acing tech interviews 2 at a time</h3>
        <Button variant="primary" size="lg" className="mt-5 pp-button">Sign Up</Button>{' '}
      </div>

      <div className="container text-center bg-light-blue vert-center-sm">
        <div class="row">
          <div class="col-lg-6">

          </div>


          <div class="col-lg-6">
            <h1 className="display-4 text-white">How it works</h1>
          </div>
        </div>

      </div>
    </Layout>
  );
};

export default HomePage;
